import styled from 'styled-components';


export const Content = styled.div`
overflowY: scroll;
height: 2500px;
`;

export const Button = styled.div`
position: fixed; 
width: 100%;
/* align-items: right ; */
/* justify-items: right */
right: 20px;
bottom: 40px;
height: 20px;
font-size: 3rem;
z-index: 1;
cursor: pointer;
color: green;
@media screen and (max-width:480){
    margin-left:10rem ;
margin-bottom:1rem ;
}

`
